function Navbar()
{
    function filter()
    {
        alert("hi")
    }
    return (
        <nav class="navbar bg-warning">
            <p class="navbar-brand">Med+</p>
            <input onKeyUp={filter()} type="dropdown" class="w-50 form-control rounded" placeholder="Search for the product..."/>
            <div class="nav">
                <a href="/" class="nav-link">Link1</a>
                <a href="/" class="nav-link">Link2</a>
                <a href="/" class="nav-link">Link3</a>
                <a href="/" class="nav-link">Link4</a>
            </div>
        </nav>
    )
}

export default Navbar;
